  false,\n\t\"url\": null,\n\t\"notes\": \"This living document provides a condensed
  explanation of wetland management history and a large-scale tidal marsh restoration
  project at Prime Hook NWR in Delaware.  It describes the biological and abiotic
  monitoring efforts associated with the restoration project, in effect as of 2015.
  \ It includes a review of relevant CCP/HMP objectives, presents a restoration project
  objective, and outlines monitoring efforts as they relate to the project objectives.
  \ Methods and protocols are defined but not included in detail.  The document will
  be updated as needed for subsequent years.\",\n\t\"license_title\": \"License Not
